import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';
// import Header from './Components/Header'
import User from './Views/User'

function App() {

  return (
    <div className="App">
      <Router>
        {/* <Header/> */}

        <Switch>
          <Route exact path="/">
            <User/>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
